		function hoverBtn(b) {
			b.currentTarget.gotoAndStop(1); //מעבר לפריים השני בסימבול הכפתור כאינדיקציה למעבר עכבר
			b.currentTarget.cursor = "pointer"; //שינוי העכבר לפויינטר
		}
		
		//פונקציה המופעלת על כפתורים בעת יציאה ממעבר עכבר
		function outBtn(b) {
			b.currentTarget.gotoAndStop(0); //החזרת הכפתור לפריים ראשון מצבו הרגיל
			b.currentTarget.cursor = "default"; //שינוי העכבר ל-חץ דיפולטיבי
		}
		
