			bigger.y = stageH / 2;
			stage.addChild(bigger); //יצירת התמונה הגדולה על הבמה
		
			//יצירת תיבת טקסט המורה לשחקן ללחוץ על התמונה על מנת להקטינה
			//הסגירה של התמונה לא קוראת במעבר עכבר מכיוון והזכוכית מגדלת המקורית קטנה
			// וקשה להשאיר את העכבר בדיוק עליה שיהיה ניתן לראות באמת את התמונה בלי שתיסגר ברגע.
			var instruct = new createjs.Text();
